    #[doc = "      {"]
    #[doc = "          // Bit 4 was set before xEventGroupClearBits() was called.  It will"]
    #[doc = "          // now be clear."]
    #[doc = "      }"]
    #[doc = "      else"]
    #[doc = "      {"]
    #[doc = "          // Neither bit 0 nor bit 4 were set in the first place."]
    #[doc = "      }"]
